import React from "react";
import "../../components/homeContent/becomeInstructor2.css";

function BecomeInstructor2() {
  return (
    <div className="becomeInstructorDiv">
      <div className="backgroundColorDiv"></div>
      <img
        src="https://www.google.com/imgres?imgurl=https%3A%2F%2Fi.pinimg.com%2Foriginals%2F9f%2Fea%2Ff9%2F9feaf9752d404a9bbef83eaed4b4dd86.jpg&tbnid=rFufVITC0H5msM&vet=12ahUKEwiT4bmWyKyBAxX2QGwGHVqzA5gQMygdegUIARCcAQ..i&imgrefurl=https%3A%2F%2Fwww.pinterest.com%2Fpin%2Fbusiness-woman-working-on-laptop-computer-at-office-sponsored-ad-sponsored-woman-office-computer-business--648870258809319243%2F&docid=Ycek26kJx06qWM&w=1300&h=996&q=image%20of%20a%20girl%20with%20laptop%20in%20corporate&ved=2ahUKEwiT4bmWyKyBAxX2QGwGHVqzA5gQMygdegUIARCcAQ"
        alt="instructorImg"
        className="instructorImg"
      ></img>
      <div className="contentDiv">
      <div className="startTeching button">About us</div>
        <h2 className="heading">Become an instructor</h2>
        <p className="about">
          Top instructors from around the world teach millions of students on
          Valmiki. We provide the tools and skills to teach what you love.{" "}
        </p>
   
      </div>
    </div>
  );
}

export default BecomeInstructor2;
